import React, { useEffect, useRef } from 'react';
import { Play, Pause, RotateCcw, Maximize } from 'lucide-react';

const SimulationWindow = () => {
  const canvasRef = useRef(null);
  const [isPlaying, setIsPlaying] = React.useState(true);

  const drawSimulation = (ctx, width, height) => {
    // Clear canvas
    ctx.fillStyle = '#18181b';
    ctx.fillRect(0, 0, width, height);

    // Draw intersection
    ctx.strokeStyle = '#71717a';
    ctx.lineWidth = 2;
    ctx.setLineDash([]);

    // Horizontal road
    ctx.fillStyle = '#3f3f46';
    ctx.fillRect(0, height/2 - 40, width, 80);
    
    // Vertical road
    ctx.fillRect(width/2 - 40, 0, 80, height);

    // Draw lane markings
    ctx.strokeStyle = '#a1a1aa';
    ctx.lineWidth = 1;
    ctx.setLineDash([10, 10]);
    
    // Horizontal lane markings
    ctx.beginPath();
    ctx.moveTo(0, height/2);
    ctx.lineTo(width, height/2);
    ctx.stroke();
    
    // Vertical lane markings
    ctx.beginPath();
    ctx.moveTo(width/2, 0);
    ctx.lineTo(width/2, height);
    ctx.stroke();

    // Draw traffic lights
    drawTrafficLight(ctx, width/2 - 60, height/2 - 60, 'red');
    drawTrafficLight(ctx, width/2 + 60, height/2 - 60, 'green');
    drawTrafficLight(ctx, width/2 - 60, height/2 + 60, 'green');
    drawTrafficLight(ctx, width/2 + 60, height/2 + 60, 'red');

    // Draw vehicles
    drawVehicle(ctx, width/4, height/2 - 15, '#22c55e', 'car');
    drawVehicle(ctx, width/4 + 50, height/2 - 15, '#3b82f6', 'car');
    drawVehicle(ctx, width/2 - 15, height/4, '#ef4444', 'ambulance');
    drawVehicle(ctx, width * 3/4, height/2 + 15, '#f59e0b', 'bus');
  };

  const drawTrafficLight = (ctx, x, y, color) => {
    ctx.fillStyle = '#27272a';
    ctx.fillRect(x, y, 20, 40);
    
    // Draw light
    ctx.fillStyle = color === 'red' ? '#ef4444' : color === 'green' ? '#22c55e' : '#71717a';
    ctx.beginPath();
    ctx.arc(x + 10, y + (color === 'red' ? 10 : 30), 6, 0, 2 * Math.PI);
    ctx.fill();
  };

  const drawVehicle = (ctx, x, y, color, type) => {
    ctx.fillStyle = color;
    if (type === 'ambulance') {
      ctx.fillRect(x, y, 30, 18);
      // Add cross
      ctx.fillStyle = '#ffffff';
      ctx.fillRect(x + 12, y + 4, 6, 10);
      ctx.fillRect(x + 9, y + 7, 12, 4);
    } else if (type === 'bus') {
      ctx.fillRect(x, y, 40, 18);
      // Add windows
      ctx.fillStyle = '#1e293b';
      ctx.fillRect(x + 5, y + 2, 30, 6);
    } else {
      ctx.fillRect(x, y, 25, 15);
    }
  };

  useEffect(() => {
    // Initialize simulation canvas
    const canvas = canvasRef.current;
    if (canvas) {
      const ctx = canvas.getContext('2d');
      drawSimulation(ctx, canvas.width, canvas.height);
    }
  }, []);

  return (
    <div className="bg-white border border-primary-200">
      <div className="border-b border-primary-200 px-4 py-3 bg-primary-100">
        <div className="flex items-center justify-between">
          <h2 className="text-lg font-semibold text-primary-900">Live Traffic Simulation</h2>
          <div className="flex items-center space-x-2">
            <button 
              onClick={() => setIsPlaying(!isPlaying)}
              className="p-2 text-primary-600 hover:text-primary-900 hover:bg-primary-200 transition-colors"
            >
              {isPlaying ? <Pause className="w-4 h-4" /> : <Play className="w-4 h-4" />}
            </button>
            <button className="p-2 text-primary-600 hover:text-primary-900 hover:bg-primary-200 transition-colors">
              <RotateCcw className="w-4 h-4" />
            </button>
            <button className="p-2 text-primary-600 hover:text-primary-900 hover:bg-primary-200 transition-colors">
              <Maximize className="w-4 h-4" />
            </button>
          </div>
        </div>
      </div>
      
      <div className="relative">
        <canvas 
          ref={canvasRef}
          width={800}
          height={400}
          className="w-full h-auto border-none"
          style={{ maxHeight: '400px' }}
        />
        
        {/* Simulation Stats Overlay */}
        <div className="absolute top-4 left-4 bg-primary-900 bg-opacity-90 p-3 text-white">
          <div className="text-xs font-mono">
            <div>Simulation Time: 14:23:15</div>
            <div>Active Vehicles: 12</div>
            <div>Emergency Vehicles: 1</div>
            <div>Avg Speed: 35 km/h</div>
          </div>
        </div>
        
        {/* Status Indicator */}
        <div className="absolute top-4 right-4 flex items-center space-x-2">
          <div className="w-2 h-2 bg-success-500 animate-pulse"></div>
          <span className="text-xs font-mono text-success-600">LIVE</span>
        </div>
      </div>
    </div>
  );
};

export default SimulationWindow;
